    false,nt"url": null,nt"notes": "This annual narrative report for Lacreek
    National Wildlife Refuge outlines Refuge accomplishments during the 1971 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, fish, reptiles, and disease- is also covered. The Refuge development and
    maintenance section discusses physical developments, plantings, collections and
    receipts, and prescribed fires. Resource management is outlined; topics include
    grazing and fur harvesting. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, hunting, fishing, violations,
    and safety. Items of interest, photographs, and N-R forms are attached.",nt"owner_org":
